module.exports = "<br>\r\n<h4 class=\"title-card\">Historial Consultas</h4>\r\n<p>Encuentra el detalle de todas tus consultas realizadas</p>\r\n<br>\r\n<table class=\"table table-hover table-sm\" style=\"background-color: #f8f8f8\">\r\n\r\n    <thead class=\"head-table text-center\">\r\n        <tr>\r\n            <th scope=\"col\" style=\"border-top-left-radius: 10px;\">TIPO DE PLAN</th>\r\n            <th scope=\"col\">Nº DOCUMENTO</th>\r\n            <th scope=\"col\">APELLIDO</th>\r\n            <th scope=\"col\">EXCLUSIÓN</th>\r\n            <th scope=\"col\">FECHA</th>\r\n            <th scope=\"col\">ESTADO</th>\r\n            <th scope=\"col\" style=\"border-top-right-radius: 10px;\">DESCARGA</th>\r\n        </tr>\r\n    </thead>\r\n\r\n    <tbody>\r\n\r\n        <tr *ngFor=\"let historic of listHistoric| paginate: { itemsPerPage: 10, currentPage: p }; let i = index  \" class=\"text-center\">\r\n            <td style=\"text-decoration: underline;cursor: pointer; text-align: left; padding-left:20px;\">{{historic.namePlan}}</td>\r\n            <td>{{historic.identificationNumber}}</td>\r\n            <td style=\"text-transform: uppercase\">{{historic.lastName}}</td>\r\n            <td style=\"text-decoration: underline;cursor: pointer; color:#00559c; opacity: 0.8;\">{{historic.exclusion}}</td>\r\n            <td>{{historic.createDate}}</td>\r\n            <td [ngStyle]=\"{'color':historic.isSuccces === 'FALLIDO' ? '#e95a58' : '#3D3E3C' }\">\r\n                <span *ngIf=\"historic.isSuccces == 'FALLIDO' \">ERROR</span>\r\n                <span *ngIf=\"historic.isSuccces == 'CORRECTO' \">EXITOSO</span>\r\n            </td>\r\n            <td>\r\n                <button *ngIf=\"historic.isSuccces==='CORRECTO'\" class=\"btn-custom btn-rounded\" (click)=\"downdloadPdf(historic.jsonResponse)\">Descarga</button>\r\n            </td>\r\n        </tr>\r\n\r\n    </tbody>\r\n</table>\r\n<div class=\"text-center\">\r\n    <pagination-controls (pageChange)=\"p = $event\" nextLabel=\"Siguiente\" previousLabel=\"Atrás\"></pagination-controls>\r\n</div>\r\n<h4 class=\"text-card-body text-center\" style=\"font-size: 13px;\">*Recuerda que las consultas en estado de error no son descontadas de tu plan.<br> *Una Exclusión está determinada por los resultados de validación del documento en centrales de Riesgo.<br> *Para mayor información puedes consultar nuestro <a style=\"text-decoration: underline;cursor: pointer; color:#00559c; \"\r\n        href=\"/centro-de-ayuda\"> Centro de Ayuda</a>\r\n</h4>\r\n<!-- <div class=\"row\">\r\n  <div class=\"col-lg-12\">\r\n    <div class=\"row\">\r\n      <div class=\"col-lg-2\"></div>\r\n      <div class=\"col-lg-2\"></div>\r\n      <div class=\"col-lg-2\"></div>\r\n      <div class=\"col-lg-2\"></div>\r\n      <div class=\"col-lg-2\"></div>\r\n      <div class=\"col-lg-2\"></div>\r\n      <div class=\"col-lg-2\"></div>\r\n    </div>\r\n    <div class=\"row\" class=\"col-lg-12\" *ngFor=\"let historic of listHistoric;let index = index;trackBy:trackByIndex;\">\r\n      <div class=\"col-lg-2\">{{historic.namePlan}}</div>\r\n      <div class=\"col-lg-2\">{{historic.identificationNumber}}</div>\r\n      <div class=\"col-lg-2\">{{historic.lastName}}</div>\r\n      <div class=\"col-lg-2\">{{historic.createDate}}</div>\r\n      <div class=\"col-lg-2\">{{historic.exclusion}}</div>\r\n      <div class=\"col-lg-2\">{{historic.isSuccces}}</div>\r\n      <div class=\"col-lg-2\">{{historic.namePlan}}</div>\r\n    </div>\r\n  </div>\r\n</div> -->\r\n"

